import axios from "axios"
import { Dispatch } from "react"
import { ImagesActions } from "../../types/images"



export const fetchImages = () => {
    return async (dispatch: Dispatch<ImagesActions>) => {
        try {
            const response = await axios.get('https://api.unsplash.com/search/photos?client_id=Ip0XA55zY7b7-d19osq1L5btGg-YCeDZVpnnJjXqHxs&query=car&per_page=20')

            console.log(response.data.results);

        } catch {

        }
    }
}
